import React, { Component } from "react";
import SquareOfCheckboxTable from "./Ds_ghe";

export default class DanhSachGhe extends Component {
  render() {
    return (
      <div className="w-40">
        <p className="text-warning text-center display-4">
          Đặt vé xem phim cre by Huy
        </p>
        <div className="text-center display-5">
          <input className="mr-10" type="text" placeholder="Họ và tên" />
          <input type="number" placeholder="Số ghề muốn đặt" />
        </div>
        <div>
          <button className="btn btn-warning">Select seat</button>
        </div>
        <p className="text-center text-light display-5 screen">Màn hình</p>
        <SquareOfCheckboxTable />
      </div>
    );
  }
}
